import React from 'react';
import Userinput from "./languages";

class Show extends React.Component {

  render() {

    return(
      <div>

        <h2>Search Results!</h2>

        {<p>Job Type: { this.props. type }</p>}
        {<p>URL: { this.props. url }</p>}
        <p>Created At: { this.props. created_at }</p>
        <p>Cmpany Name: { this.props. company }</p>
        <p>Company URL: { this.props. company_url }</p>
        <p>Job Location: { this.props. location }</p>
        <p>Job Title: { this.props. job_title }</p>
        <p>Job Description: { this.props. description }</p>
        <p>Company Logo: { this.props. company_logo }</p>
        <p>How to apply: { this.props. how_to_apply }</p>

      </div>
    );
  }
};


export default App;
